/// Display Bash usage breakdown
fn display_bash_breakdown(session: &SessionAnalysis) {
    let bash_analyses = analyze_bash_commands(session);

    if bash_analyses.is_empty() {
        return;
    }

    // カテゴリ別に集計
    let mut category_totals: Vec<_> = bash_analyses
        .iter()
        .map(|(cat, analyses)| {
            let total: u64 = analyses.iter().map(|a| a.tokens.total).sum();
            let count: u32 = analyses.len() as u32;
            (cat.as_str(), total, count)
        })
        .collect();

    category_totals.sort_by(|a, b| b.1.cmp(&a.1));

    let bash_total: u64 = category_totals.iter().map(|(_, t, _)| t).sum();

    for (cat, tokens, count) in category_totals.iter().take(3) {
        let percentage = if bash_total > 0 {
            (*tokens as f64 / bash_total as f64) * 100.0
        } else {
            0.0
        };

        println!(
            "│      ├─ {:<10} {:>8} tokens ({:>5.1}% of Bash, {}回) │",
            cat,
            format_number(*tokens),
            percentage,
            count
        );
    }
}

