#[derive(Parser)]
#[command(name = "tokstat")]
#[command(about = "visualize and analyze token usage across coding agent sessions for ClaudeCode and CodexCLI", long_about = None)]
struct Cli {
    #[command(subcommand)]
    command: Option<Command>,

    #[arg(long)]
    all: bool,

    #[arg(value_name = "PATH")]
    path: Option<PathBuf>,
}

#[derive(Subcommand, Debug)]
enum Command {
    Claude,
    Codex,
}

fn main() -> Result<()> {
    env_logger::init();
    let cli = Cli::parse();
    match cli.command {
        Some(Command::Claude) => {
            debug!("claude mode");
            let path = cli.path;
            let all = cli.all;
            handle_command(SessionType::ClaudeCode, path, all)?;
        }
        Some(Command::Codex) => {
            debug!("codex mode");
            let path = cli.path;
            let all = cli.all;
            handle_command(SessionType::Codex, path, all)?;
        }
        None => {
            debug!("codex and claude mode");
            let path = cli.path;
            let all = cli.all;
            handle_command_both(path, all)?;
        }
    }

    Ok(())
}

fn handle_command(session_type: SessionType, path: Option<PathBuf>, all: bool) -> Result<()> {
    let sessions = if all {
        collect_all_sessions(session_type)?
    } else {
        let target_path = path.unwrap_or_else(|| PathBuf::from("."));
        collect_sessions_for_path(&target_path, Some(session_type))?
    };

    if sessions.is_empty() {
        println!("{}", "No sessions found".red());
        return Ok(());
    }

    // Display aggregated result
    display::display_aggregated(&sessions)?;

    Ok(())
}

fn handle_command_both(path: Option<PathBuf>, all: bool) -> Result<()> {
    let target_path = path.unwrap_or_else(|| PathBuf::from("."));
    let sessions = if all {
        let mut all_sessions = collect_all_sessions(SessionType::ClaudeCode)?;
        all_sessions.extend(collect_all_sessions(SessionType::Codex)?);
        all_sessions
    } else {
        collect_sessions_for_path(&target_path, None)?
    };

    if sessions.is_empty() {
        println!("{}", "No project found".red());
        return Ok(());
    }
    debug!("collected {} sessions", sessions.len());
    display::display_aggregated(&sessions)?;

    Ok(())
}

/// Collect all sessions from home directory for specified session type
fn collect_all_sessions(session_type: SessionType) -> Result<Vec<models::SessionAnalysis>> {
    let home = std::env::var("HOME").or_else(|_| std::env::var("USERPROFILE"))?;
    let base_path = match session_type {
        SessionType::ClaudeCode => PathBuf::from(home).join(".claude/projects"),
        SessionType::Codex => PathBuf::from(home).join(".codex/sessions"),
    };

    if !base_path.exists() {
        return Ok(Vec::new());
    }

    collect_sessions_from_dir(&base_path, Some(session_type))
}

