/// Collect sessions from a directory
fn collect_sessions_from_dir(
    path: &PathBuf,
    filter_type: Option<SessionType>,
) -> Result<Vec<models::SessionAnalysis>> {
    let mut sessions = Vec::new();

    for entry in walkdir::WalkDir::new(path)
        .into_iter()
        .filter_map(|e| e.ok())
    {
        if entry.path().extension().and_then(|s| s.to_str()) == Some("jsonl") {
            if let Some(session_type) = detect_session_type(entry.path()) {
                if filter_type.is_none() || filter_type == Some(session_type) {
                    if let Ok(session) = parse_session_file(entry.path(), session_type) {
                        sessions.push(session);
                    }
                }
            }
        }
    }

    Ok(sessions)
}
